import { useParams } from "react-router-dom";
import useFetch from "./useFetch";
const BlogDetails = () => {
    const {id} =useParams();
    const {data:blogs,error,isPending}=useFetch();

    return ( 
        <div className="blog-details">
          {isPending && <div></div>}
          {error && <div></div>}
          {blogs && <div></div>}
        </div>
     );
}
 
export default BlogDetails;
